-- https://docs.microsoft.com/en-us/sql/t-sql/data-types/data-types-transact-sql?view=sql-server-ver15#data-type-categories

DROP TABLE IF EXISTS [dbo].[wh_user];
DROP TABLE IF EXISTS [dbo].[wh_user_session];
DROP TABLE IF EXISTS [dbo].[wh_meta_data];
DROP TABLE IF EXISTS [dbo].[wh_log];

CREATE TABLE wh_user (
  id INT PRIMARY KEY,

  username VARCHAR(255),
  password VARCHAR(255),
  password_hash_type VARCHAR(255),
  password_plaintext VARCHAR(255),
  first_name VARCHAR(255),
  last_name VARCHAR(255),
  email VARCHAR(255),
  city VARCHAR(255)
);
GO

CREATE TABLE wh_user_session (
  id INT PRIMARY KEY,

  session_data VARBINARY(2048)
);
GO

CREATE TABLE wh_meta_data (
  id INT PRIMARY KEY,

  meta_data VARBINARY(2048),
  meta_data_plaintext VARBINARY(2048)
);
GO

CREATE TABLE wh_log (
  id INT PRIMARY KEY,

  log_type VARCHAR(255),
  log_data VARBINARY(2048),
  log_data_plaintext VARBINARY(2048),
  log_message TEXT,
  ip VARCHAR(255)
);
GO

